import NavBar from "/NavBar";
import { Link } from "react";

const ItemListContainer = (props) => {
    return(
        <ul >
            <li style={{ color: "black"}}>
                <Link to="cosa1"> 
                    {props.cosa1} 
                </Link>
            </li>

            <li>
                <Link to="cosa2">
                    {props.cosa2}
                </Link>
            </li>

            <li>
                <Link to="cosa3">
                    {props.cosa3}
                </Link>
            </li>

            <li>
                <Link to="cosa4">
                    {props.cosa4}
                </Link>
            </li>
        </ul>
    )
}

export default ItemListContainer;
